const apiKey = 'bm86GEhDhlL0VQT5LE0yXlOrMbiDpRQO';
const randomEndpoint = 'https://api.giphy.com/v1/gifs/random';

const peticion = fetch(`${randomEndpoint}?api_key=${apiKey}`);

peticion
    .then((resp) => {
        resp.json();
    })
    .then((data) => {
        console.log(data);
    })
    .catch(console.warn);
